import BackLink from "./BackLink";
import { EXPENSES_SCREEN } from "./constants";

const ResultsScreen = ({ results, setCurrentScreen }) => {
  return (
    <div>
      <BackLink
        newScreen={EXPENSES_SCREEN}
        setCurrentScreen={setCurrentScreen}
      />

      {results}
    </div>
  );
};
export default ResultsScreen;
